// 
// CUSTOM ANIMATIONS - Asset Reveal & Service Interactions
// 

(function() {
  'use strict';

  // Wait for GSAP and ScrollTrigger to be available
  function initCustomAnimations() {
    if (typeof gsap === 'undefined' || typeof ScrollTrigger === 'undefined') {
      console.warn('GSAP or ScrollTrigger not found, retrying...');
      setTimeout(initCustomAnimations, 100);
      return;
    }

    gsap.registerPlugin(ScrollTrigger);

    // Asset Reveal Animations (down, up, left, right)
    function initAssetRevealAnimations() {
      const revealElements = document.querySelectorAll('[asset-reveal]');

      revealElements.forEach((element) => {
        const direction = element.getAttribute('asset-reveal');

        let fromVars = {
          opacity: 0,
          duration: 1.2,
          ease: 'power3.out'
        };

        switch(direction) {
          case 'down':
            fromVars.y = -60;
            break;
          case 'up':
            fromVars.y = 60;
            break;
          case 'left':
            fromVars.x = 60;
            break;
          case 'right':
            fromVars.x = -60;
            break;
          default:
            fromVars.y = 40;
        }

        gsap.from(element, {
          ...fromVars,
          scrollTrigger: {
            trigger: element,
            start: 'top 85%',
            end: 'top 20%',
            toggleActions: 'play none none reverse'
          }
        });
      });
    }

    // Service Card Stagger Animations
    function initServiceAnimations() {
      const services = document.querySelectorAll('.c-service-card');

      services.forEach((service) => {
        const heading = service.querySelector('.c-heading-5');
        const number = service.querySelector('.c-service-number');
        const text = service.querySelector('.c-text-1');
        const button = service.querySelector('.c-button');
        const image = service.querySelector('.c-row_img');

        const tl = gsap.timeline({
          scrollTrigger: {
            trigger: service,
            start: 'top 80%',
            end: 'top 20%',
            toggleActions: 'play none none reverse'
          }
        });

        tl.from(number, { opacity: 0, scale: 0.8, duration: 0.4, ease: 'back.out(1.7)' })
          .from(heading, { opacity: 0, y: 20, duration: 0.6, ease: 'power2.out' }, '-=0.2')
          .from(text, { opacity: 0, y: 20, duration: 0.6, ease: 'power2.out' }, '-=0.4')
          .from(image, { opacity: 0, scale: 0.95, duration: 0.8, ease: 'power2.out' }, '-=0.6')
          .from(button, { opacity: 0, y: 20, duration: 0.6, ease: 'power2.out' }, '-=0.4');
      });
    }

    // Button Hover Animations
    function initButtonAnimations() {
      const buttons = document.querySelectorAll('.c-button.cc-main');

      buttons.forEach((button) => {
        const arrow = button.querySelector('.c-button_arrow-wrap');

        button.addEventListener('mouseenter', () => {
          if (arrow) gsap.to(arrow, { x: 5, duration: 0.3, ease: 'power2.out' });
          gsap.to(button, { scale: 1.02, duration: 0.3, ease: 'power2.out' });
        });

        button.addEventListener('mouseleave', () => {
          if (arrow) gsap.to(arrow, { x: 0, duration: 0.3, ease: 'power2.out' });
          gsap.to(button, { scale: 1, duration: 0.3, ease: 'power2.out' });
        });
      });
    }

    // Initialize all animations
    function initAllAnimations() {
      initAssetRevealAnimations();
      initServiceAnimations();
      initButtonAnimations();
    }

    // Run on DOM ready
    if (document.readyState === 'loading') {
      document.addEventListener('DOMContentLoaded', initAllAnimations);
    } else {
      initAllAnimations();
    }

    // Refresh ScrollTrigger on resize
    let resizeTimer;
    window.addEventListener('resize', () => {
      clearTimeout(resizeTimer);
      resizeTimer = setTimeout(() => {
        ScrollTrigger.refresh();
      }, 250);
    });

    console.log('Custom animations initialized successfully');
  }

  // Start initialization
  initCustomAnimations();
})();
